import { useState, useEffect } from "react";
import axios from "axios";

function Performence(id) {
  const [performence, setPerformence] = useState(null)

  useEffect(() => {
    axios.get(`http://localhost:3000/user/12/performance`)
    .then((response) => {
      setPerformence(response.data)
    })
  }, [id])
  // ---------------------------

  return (
    <div >
      <h1>Performence graph</h1>
      <p>{performence?.data.userId}</p>
    </div>
  );
}

export default Performence;
